import './App.css';
import logo from './assets/logo.jpg';

import {Routes, Route, Link, useNavigate} from "react-router-dom";
import {useState} from "react";

import DoctorStrange from './doctorstrange';
import MainPage from './MainPage';

function App() {
  const[movieName, setMovieName] = useState("Doctor Strange");

  function movieDoctorStrange(){
    setMovieName("Doctor Strange")
  }


  const navigate= useNavigate();
  function Navigator(position){
    navigate(position)
  }

  return (


      <Routes>
        <Route exact path="/" element={<MainPage navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
      </Routes>
  );
}

export default App;
